import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  createUrl() {
    var ticker = document.getElementById('ticker-input');
    if (ticker)
      return "http://localhost:8000/" + ticker;
    return "http://localhost:8000/"
  }

  render() {

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          var url = this.createUrl;
          <strong>url</strong>
          <a
            href = "http://localhost:8000?variable=(?)"
            target="_blank"
            > Today's Stock Price</a>
            <form onSubmit className="search-form">
              <input
                id = "ticker-input"
                type="text"
                placeholder="Enter search ticker..."
              />
              <div>
                <button href = "http://localhost:8000">Today's Stock Price</button>
              </div>
            </form>
        </header>
      </div>
    );
  }

}

export default App;
